import React from 'react';
import FileContent from '../components/FileContent';

function Display({ fileContent }) {
    return (
        <div>
            <h1>Display Page</h1>
            <div className="file-display">
                <FileContent content={fileContent} />
            </div>
        </div>
    );
}

export default Display;
